import React from "react";
import { Typography, Box, Stack, Card, CardActions, CardContent, Button } from "@mui/material";
import { Link } from "react-router-dom";

const cardStyle = {
	width: '100%',
	border: '2px',
	boxShadow: 6,
	p: 2,
	textAlign: 'center'
};

const Transaction = () => {
	return (
		<div>
			<React.Fragment>
				<Box sx={{ p: 2 }}>
					<Stack spacing={1} direction="column" justifyContent="center" alignItems="center">
						<Typography variant="h6">Transaction List</Typography>
						<Box>
						<Card
							sx={cardStyle}
						>
							<CardContent>
								<Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
									Word of the Day
								</Typography>

								<Typography sx={{ mb: 1.5 }} color="text.secondary">
									adjective
								</Typography>
								<Typography variant="body2">
									well meaning and kindly.

								</Typography>
							</CardContent>
							<CardActions>
								<Button size="small">Learn More</Button>
							</CardActions>
						</Card>
						</Box>
					</Stack>
				</Box>
			</React.Fragment>
		</div>
	);
};

export default Transaction;
